const UserModel = require('../models/user');
const KudoModel = require('../models/kudo');
const dummy = require('mongoose-dummy');

module.exports = {
    generate: async function() {
        let promiseList = [];
        //add users
        for(let i = 0;i<100;i++){
        let randomUser = dummy(UserModel,{})
        const user = new UserModel(randomUser)
        promiseList.push(user.save());
        }
        await Promise.all(promiseList);
        const userIds = await UserModel.find({},'_id').exec();

        promiseList = [];
        // add kudos
        for(let i = 0;i<10;i++){
            let randomKudo = dummy(KudoModel,{})
            let kudo = new KudoModel(randomKudo)
            kudo.createdBy = userIds[Math.floor(Math.random() * userIds.length)]._id;
            kudo.receiver = userIds[Math.floor(Math.random() * userIds.length)]._id;
            kudo.imageString = `data:image/png;base64,`
            promiseList.push(kudo.save());
        }



        return Promise.all(promiseList);
    },
};
